import { useEffect } from "react";

function App() {

  useEffect(() => {
    async function getPacientes() {
      const res = await fetch("http://localhost:5000/api/pacientes");
      const pacientes = await res.json();
      console.log(pacientes);
    }
    getPacientes();

  }, []);



  return (
    <main className="container">
      Hello World
    </main>
  );
}

export default App;
